import React, {useState, useEffect}from 'react'
import { CharactersPrint } from './Components/CharactersPrint';

export const Staff = () => {

    const [staff, setProducts] = useState([]);

    useEffect(() => {
        getCharacters();
    }, [])
    
    const getCharacters = async () => {
        const data = await fetch('http://localhost:3001/staff');
        const charactersData = await data.json();
        setProducts(charactersData);
    }


    return(
        <>
            <button onClick={staff.map((characters) => (
                <CharactersPrint characters={characters}/>
            ))}>staff</button>
        </>
    );
    
}
